// Your encoded Base64 URL
const encodedURL = "data:application/font-woff;base64,";

// Decode the URL
const decodedURL = decodeURIComponent(encodedURL);

// Extract the Base64-encoded data from the URL
const base64Data = decodedURL.split(",")[1]; // Assuming the format is "data:base64,<encoded_data>"

// Decode the Base64 data
const decodedData = atob(base64Data);

// Utilize the decoded data
// console.log(decodedData); // This will show the decoded data

const finalURL =encodeURIComponent(decodedData);

console.log(finalURL)

